import React, { useState, useEffect, useContext } from 'react';
import { useAuth } from '../context/AuthContext';
import { Link, Navigate, useNavigate } from 'react-router-dom'; // Added useNavigate
import { getAllProperties } from '../api/property'; // Import to fetch all properties
// API calls for user-specific data
// import { getUserBookings } from '../api/booking';
// import { getUserListings } from '../api/user'; // or from property API: getPropertiesByOwner
// import { getUserReviews } from '../api/review';
import PropertyCard from '../components/PropertyCard'; // Assuming you have a PropertyCard component
// import ReviewList from '../components/ReviewList';

const UserDashboard = () => {
  const { user, token, isLoading, logout } = useAuth();
  const navigate = useNavigate(); // For navigation
  const [bookings, setBookings] = useState([]);
  // const [listings, setListings] = useState([]); // Will be replaced by allProperties
  const [allProperties, setAllProperties] = useState([]); // State for all properties
  const [reviews, setReviews] = useState([]);
  const [error, setError] = useState('');
  const [loadingData, setLoadingData] = useState(true);

  useEffect(() => {
    if (!isLoading && !user) {
      console.log('UserDashboard useEffect: Initial load, no user yet or not logged in.');
      setLoadingData(false); // Not loading if no user
      setAllProperties([]); // Clear properties
      return;
    }

    if (token && user) {
      console.log('UserDashboard useEffect: Token and user exist, proceeding to fetch data.');
      const fetchData = async () => {
        setLoadingData(true);
        setError('');
        try {
          console.log('UserDashboard useEffect: Calling getAllProperties...');
          const apiResponse = await getAllProperties();
          
          // Log the raw response object directly to the console for inspection
          console.log('UserDashboard useEffect: Raw API Response:', apiResponse);

          if (apiResponse && Array.isArray(apiResponse.properties)) {
            setAllProperties(apiResponse.properties);
            console.log('UserDashboard useEffect: Successfully set properties. Count:', apiResponse.properties.length);
          } else {
            // This log helps identify if the structure is not what's expected
            console.warn('UserDashboard useEffect: apiResponse.properties is not an array or apiResponse is invalid. Received:', apiResponse);
            setAllProperties([]); // Default to empty array
          }
        } catch (err) {
          console.error('UserDashboard useEffect: Error during fetchData:', err);
          setError(err.message || 'Failed to load dashboard data. Check console for details.');
          setAllProperties([]); // Clear properties on error
        } finally {
          setLoadingData(false); // Ensure loading is set to false in all cases
        }
      };
      fetchData();
    } else if (!isLoading) { // If not loading from AuthContext, but no token/user
        console.log('UserDashboard useEffect: User or token not available after auth check, skipping fetch.');
        setLoadingData(false); 
        setAllProperties([]); 
    }
  }, [user, token, isLoading]);

  if (isLoading || loadingData) {
    return <div>Loading dashboard...</div>;
  }

  if (!user) {
    return <Navigate to="/login" replace />;
  }

  // Placeholder handlers
  const handleCancelBooking = (bookingId) => {
    console.log(`Cancel booking ${bookingId}`);
    // Call API: cancelBooking(bookingId, token).then(...)
  };

  // Navigate to property detail page
  const handleViewProperty = (propertyId) => {
    navigate(`/property/${propertyId}`);
  };

  return (
    <div className="container mx-auto p-4">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-3xl font-bold">Welcome, {user.name}!</h1>
        <div>
          <Link 
            to="/rent-your-place" 
            className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded mr-2"
          >
            List Your Property
          </Link>
          <button 
            onClick={logout} 
            className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded"
          >
            Logout
          </button>
        </div>
      </div>
      {error && <p className="text-red-500 bg-red-100 p-3 rounded mb-4">Error: {error}</p>}

      {/* All Properties Section */}
      <section className="mb-8">
        <h2 className="text-2xl font-semibold mb-4">All Properties</h2>
        {allProperties && allProperties.length > 0 ? (
          <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
            {allProperties.map(property => (
              // Assuming PropertyCard can take a property object and a click handler
              // If PropertyCard is not designed for this, we'll inline the JSX
              // For now, let's create a simple card structure here
              <div key={property._id} className="bg-white p-4 rounded-lg shadow cursor-pointer hover:shadow-lg" onClick={() => handleViewProperty(property._id)}>
                <img src={property.image || 'https://via.placeholder.com/300x200.png?text=No+Image'} alt={property.name} className="w-full h-48 object-cover rounded-md mb-2" />
                <h3 className="text-xl font-semibold">{property.name}</h3>
                <p className="text-gray-600">{property.location}</p>
                <p className="text-lg font-bold text-indigo-600">${property.price} / night</p>
                {/* Add a Link or Button to view details if not making the whole card clickable */}
                {/* <Link to={`/property/${property._id}`} className="text-indigo-600 hover:text-indigo-800">View Details</Link> */}
              </div>
            ))}
          </div>
        ) : (
          <p>No properties found or still loading...</p>
        )}
      </section>

      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
        {/* My Bookings Section */}
        <section className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-2xl font-semibold mb-4">My Bookings</h2>
          {bookings.length > 0 ? (
            <ul className="space-y-3">
              {bookings.map(booking => (
                <li key={booking._id} className="p-3 border rounded-md">
                  <p><strong>Property:</strong> {booking.propertyTitle}</p>
                  <p><strong>Dates:</strong> {new Date(booking.startDate).toLocaleDateString()} - {new Date(booking.endDate).toLocaleDateString()}</p>
                  <p><strong>Status:</strong> <span className={`capitalize px-2 py-1 text-xs font-semibold rounded-full ${booking.status === 'confirmed' ? 'bg-green-200 text-green-800' : 'bg-yellow-200 text-yellow-800'}`}>{booking.status}</span></p>
                  {booking.status !== 'cancelled' && booking.status !== 'completed' && (
                     <button onClick={() => handleCancelBooking(booking._id)} className="mt-2 text-sm bg-red-500 hover:bg-red-600 text-white py-1 px-3 rounded">Cancel Booking</button>
                  )}
                </li>
              ))}
            </ul>
          ) : <p>You have no bookings.</p>}
          <Link to="/" className="mt-4 inline-block text-indigo-600 hover:text-indigo-800">Find a place to stay &rarr;</Link>
        </section>

        {/* My Reviews Section */}
        <section className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-2xl font-semibold mb-4">My Reviews</h2>
          {reviews.length > 0 ? (
            <ul className="space-y-3">
              {reviews.map(review => (
                <li key={review._id} className="p-3 border rounded-md">
                  <p><strong>Property:</strong> {review.propertyTitle}</p>
                  <p><strong>Rating:</strong> {review.rating}/5</p>
                  <p><strong>Comment:</strong> {review.comment}</p>
                </li>
              ))}
            </ul>
          ) : <p>You have not submitted any reviews.</p>}
        </section>
        
        <section className="bg-white p-6 rounded-lg shadow">
            <h2 className="text-2xl font-semibold mb-4">Account Details</h2>
            <p><strong>Name:</strong> {user.name}</p>
            <p><strong>Email:</strong> {user.email}</p>
            <p><strong>Role:</strong> {user.role}</p>
            <Link to="/profile/edit" className="mt-3 inline-block text-indigo-600 hover:text-indigo-800">Edit Profile &rarr;</Link>
        </section>
      </div>
    </div>
  );
};

export default UserDashboard;
